import React from "react";
import Card from "../../componants/card/Card";
import Title from "../../componants/common/Title";
import styles from "../../style/common/card.module.css";

function SweatShirts() {
  const sweatshirts = [
    {
      src: "/images/Sweat-1.jpeg",
      title: "BAD-MOSS (Grey)",
      desc: "₹1,499.00",
    },
    {
      src: "/images/Sweat-2.jpeg",
      title: "Chore Haryana Aale – Black",
      desc: "₹1,799.00",
    },
    {
      src: "/images/Sweat-3.jpeg",
      title: "BAD-MOSS (Sea Green)",
      desc: "₹1,799.00",
    },
    {
      src: "/images/Sweat-4.jpeg",
      title: "Women Printed Regular Fit Sweatshirt",
      desc: "₹1,499.00",
    },
  ];
  return (
    <div>
      <Title title="Sweatshirts" />
      <div className={styles.map2}>
        {sweatshirts.map((value, index) => {
          return (
            <Card
              key={index}
              src={value.src}
              title={value.title}
              desc={value.desc}
            />
          );
        })}
      </div>
    </div>
  );
}

export default SweatShirts;
